import React from 'react'
import Home from './Home';
import {Router,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Home/>
      <Router>
        <Routes>
          <Route path=''/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
